import React, { createContext } from "react";
import CompA from './CompA';

const fname = createContext();
const lname = createContext();


const Cont =()=>
{

    return(
        <>
<fname.Provider value={"Harshali"}>
<lname.Provider value={"Sharma"}>
    <CompA/>
    </lname.Provider>
</fname.Provider>

    </>
    );
};

export default Cont;
export {fname,lname};
